def signed(data, key):
    ''' Get a signature header for a string of data.
    '''
    hash = hmac.new(key, data.encode('utf8'), hashlib.sha1)
    signature = 'sha1={}'.format(hash.hexdigest())
    
    return {'X-Hub-Signature': signature}

